import React from 'react';
import {Box, Center} from "@chakra-ui/react";

const QuestionDialog = () => {
    return (
        <Box position={'fixed'}
             zIndex={9000}

             top={0}
             width={'100vw'} height={'100vh'} bg={'black'}>
            <Center>
                <Box
                    transform={
                        'translateX(-50%)'
                    }
                    // top={10} right={50}
                    minH={'800px'}
                    bg={'red'}
                    minW={'600px'}>
                    sdsd
                </Box>
            </Center>
        </Box>
    );
};

export default QuestionDialog;
